import express from 'express';
import axios from 'axios';
import papagoAPIOption from '../config/papago.js'
const router = express.Router();

router.post('/', async (req, res) => {
	try{
    const { q: text } = req.query;
	let target = 'en'
	let source = 'ko'
	if(req.query.target) target = req.query.target
	if(req.query.source) source = req.query.source
    const result = await axios.post('https://openapi.naver.com/v1/papago/n2mt',{source, target, text},{headers: papagoAPIOption});

	res.status(200).json({text:result.data.message.result.translatedText})
}catch(err) {
	if(!err.response) console.log(err)
	else console.log(err.response.status)
}}
	);


export default router;

